const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h1>The dojo blog</h1>
            <div className="links">
                <a href="/">Home</a>
                <br/>

                <a href="/create">New blog</a>
            </div>
        </nav>

    );
}

export default Navbar;
